import React from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Avatar from '../headerItems/avatar';
import ProfileDetials from '../headerItems/profileDetails';
import { CardMedia } from '@material-ui/core';
import TechPic from '../../../assests/images/technology.jpeg'
import Quote from  '../'
export default function profileCard() {
  const classes = {
    card: {
        height:'350px'
    },
    image: {
        width: '100%',
        height: '200px'
    },
    content: {
        position: 'relative',
        bottom: '120px'
    },
    blockContent: {
        display: 'inline-block'
    },
    quote:{
        display: 'inline-flex',
        float: 'right',
        position: 'relative',
        marginRight: '5%',
        top: '150px',
        flexDirection: 'column'
    }
  }

  return (
    <Card  style={classes.card}>
        <CardMedia image= {TechPic} style={classes.image}/>
        <CardContent style={classes.content}>
        <div style={classes.blockContent}>
            <Avatar />
            <ProfileDetials />
        </div>
        <div style={classes.quote}>
            <span><i>"If faliure is not an option, then neither is success."</i></span>
            <span style={{alignSelf: 'flex-end'}}>- Seth Godin</span>
        </div>
      </CardContent>
    </Card>
  );
}
